import React from 'react';
import { ChakraProvider, Box, useColorMode } from '@chakra-ui/react';

function App() {
  const { colorMode, toggleColorMode } = useColorMode()
  return (
    <ChakraProvider>
      <p onClick={toggleColorMode}>Hello, world</p>
    </ChakraProvider>
  );
}

export default App;
